import React from "react";
import { useState, useContext, useEffect } from "react";
import "./opportunity.css";


const StudentsCard = ({ card }) => {

  return (
    <div className="Students-Card">
      <p className="p-Students-Card">
       اسم الفرصة : 
       <br />
      {card.Opport_name}
        <br />
        <br />
        " : وصف التدريب"
        <br />
        {card.Description}
        <br />
        <br />

      </p>
    </div>
  );
};

export default StudentsCard;
